def predict_senti(content):
    predict_input = tokenizer.encode(content, truncation=True, padding=True, return_tensors="tf")
    tf_output = bert2.predict(predict_input)[0]
    tf_prediction = tf.nn.softmax(tf_output, axis=1)
    return tf_prediction[0].numpy()[1]


def read_file(filename):
    dict_he = {}
    dict_li = {}
    with open(filename, 'r', encoding='utf-8') as reader:
        for row in csv.reader(reader, delimiter=','):
            localId, TalkerId, Type, SubType, IsSender, CreateTime, Status, StrContent, StrTime = row
            this_time = StrTime.split()[0]
            if '<' not in StrContent:
                if IsSender == '0':
                    if this_time not in dict_he:
                        print(StrContent)
                        senti=predict_senti(StrContent)
                        print(senti)
                        dict_he[this_time] = [senti]
                    else:
                        print(StrContent)
                        senti = predict_senti(StrContent)
                        print(senti)
                        dict_he[this_time].append(senti)
                else:
                    if this_time not in dict_li:
                        print(StrContent)
                        senti = predict_senti(StrContent)
                        print(senti)
                        dict_li[this_time] = [senti]
                    else:
                        print(StrContent)
                        senti = predict_senti(StrContent)
                        print(senti)
                        dict_li[this_time].append(senti)
    return dict_he, dict_li


def weighted(dict_x):
    dict_t_x = {}
    for t in dict_x:
        dict_t_x[t] = (sum(dict_x[t]) / len(dict_x[t]))
    return dict_t_x

def getmonday(st):
    date = datetime.strptime(st, '%Y-%m-%d')
    week_start = date - timedelta(days=date.weekday())
    return week_start.strftime("%Y-%m-%d")

